import './App.css';

class App extends Component {

  handleClick() {
    console.log('this is:', this);
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
         <h1>Skimmer</h1>
          <form>
            <p>
            <input type="text" input="Input" placeholder="Input"/>
            </p>
            <p>
             <button onClick={(e) => this.handleClick(e)}>
              Submit
            </button>
            </p>
          </form>
        </header>
      </div>
    );
  }
}

export default App;
